import React, {useState} from 'react';

import './App.css';


function App() {
  let [state, setState] = useState({});
  const handleClick = () =>{
    fetch('http://192.168.31.190:3000/mobile', {
      method: 'get',
      headers: new Headers({
        'Authorization': 'YWxhZGRpbjpvcGVuc2VzYW1l'
      })
    })
      .then(response => response.json())
      .then(a => console.log(a));

  }

  return (
    <div className="App">
      <button className="btn" onClick={handleClick()}>OK</button>
    </div>
  );
}

export default App;
